import React from "react";
import { Link } from "react-router-dom";

const RecipeRec = ({ recipeRec }) => {
  if (recipeRec.hits) {
    console.log("label = " + recipeRec.hits[0].recipe.label)
    return (
      <div className="recipe-rec">
        <p>RecipeRec</p>
        <p>{recipeRec.hits[0].recipe.label}</p>
        <img src={recipeRec.hits[0].recipe.image} />
        <p>{recipeRec.hits[1].recipe.label}</p>
        <img src={recipeRec.hits[1].recipe.image} />
        <p>{recipeRec.hits[2].recipe.label}</p>
        <img src={recipeRec.hits[2].recipe.image} />
        <Link to="/">Back to Home.</Link>
      </div>
    );
  } else {
    return (
      <div className="recipe-rec">
        <p>Nothing yet.</p>
        <Link to="/">Back to Home.</Link>
      </div>
    );
  }
};

export default RecipeRec;
